import '../CSS/header.css';
import { BrowserRouter as Router, Routes, Route, 
  Navigate,Link } from 'react-router-dom';

import React from "react";
import Logout from "./Logout"
import icon from "../Images/userloginicon.png"

function Header() {
    return (
      <>
        <div class="topnav">
        <Link to="Home"><b> Home </b></Link>  
        <Link to="Exams"><b>Exams</b></Link>
        <Link to="UserDashboard"><b>Dashboard</b></Link>
        <Link to="Services"><b>Services</b></Link>
        {/* <Link to="AdminDashboard"><b>Admin</b></Link> */}
        <Link to="About"><b>About</b></Link>

        

        {!sessionStorage.getItem("isAuthenticated") ? (
          <></>
        ):
(<div style={{fontSize:"1.3em", color:"white",fontWeight:"bold",margin:"0.6em 0em 0 50em"}}>

<img style={{width:"100%", height:""}} src={icon}>

</img>
  
{sessionStorage.getItem("Name")}

<button style={{marginLeft:"2em", background:"#007bff",
    borderColor: "#007bff",
    fontWeight: "bold",
    color: "white",
    height: "2em",
    borderRadius: "5px"}}>Logout</button>

</div>)

}

      </div>
       </>

 

    );
  }
  
  export default Header;
